import React from 'react';

const FAQSection = () => {
  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-[#FFFF] p-8">
      {/* Родительский контейнер с фиксированными размерами */}
      <div 
        className="relative" 
        style={{ 
          width: '500px', 
          height: '400px', 
          overflow: 'hidden', // Чтобы ничего не выходило за пределы
        }}
      >
        {/* Фоновая картинка */}
        <div className="absolute" style={{ top: '0', left: '0' }}>
          <img
            src="/images/img20.png" // Замените на путь к вашей фоновой картинке
            alt="Background"
            style={{ width: '200px', height: '200px' }} // Размеры фоновой картинки
          />
        </div>

        {/* Вторая картинка, наложенная на фоновую */}
        <div className="absolute" style={{ top: '50%', left: '50%', transform: 'translate(-50%, -50%)' }}>
          <img
            src="/images/img10.png" // Замените на путь к вашей основной картинке
            alt="Placeholder"
            style={{ width: '150px', height: '150px', borderRadius: '10px' }} // Размеры и стили второй картинки
          />
        </div>

        {/* Текст и кнопки */}
        <div 
          className="absolute" 
          style={{ 
            top: '50%', 
            left: '50%', 
            transform: 'translate(-50%, 50%)', 
            width: '80%', 
            textAlign: 'center', 
            paddingLeft: '20px', // Отступ слева
          }}
        >
          {/* Заголовок */}
          <div className="text-left">
            <h1 className="text-2xl font-bold text-gray-800 mb-2">Frequently Asked Questions</h1>
            <h2 className="text-lg text-gray-600">You’ve Any Questions</h2>
          </div>

          {/* Кнопки */}
          <div className="space-y-4 mt-4">
            {/* Первая кнопка */}
            <button
              className="w-full inline-flex p-3 pl-6 justify-between items-center gap-4 rounded-lg bg-[#F8F7F0] hover:bg-[#E0DFD8] transition duration-300"
              onClick={() => alert('Button 1 clicked!')}
            >
              <h3 className="text-md font-bold text-gray-800">World’s hottest destinations for vegans</h3>
              <div
                style={{
                  display: 'flex',
                  justifyContent: 'center',
                  alignItems: 'center',
                  borderRadius: '10px',
                  background: '#C5CE38',
                  width: '40px',
                  height: '40px',
                }}
              >
                {/* Иконка или текст внутри квадрата */}
              </div>
            </button>

            {/* Вторая кнопка */}
            <button
              className="w-full inline-flex p-3 pl-6 justify-between items-center gap-4 rounded-lg bg-[#F8F7F0] hover:bg-[#E0DFD8] transition duration-300"
              onClick={() => alert('Button 2 clicked!')}
            >
              <h3 className="text-md font-bold text-gray-800">Let’s grow naturally and live naturally</h3>
              <div
                style={{
                  display: 'flex',
                  justifyContent: 'center',
                  alignItems: 'center',
                  borderRadius: '10px',
                  background: '#C5CE38',
                  width: '40px',
                  height: '40px',
                }}
              >
                {/* Иконка или текст внутри квадрата */}
              </div>
            </button>
          </div>

          {/* Текст между кнопками */}
          <div className="text-gray-600 text-sm mt-4" style={{ textAlign: 'left' }}>
            <p>
              Suspendisse finibus urna mauris, vitae consequat quam vel. Vestibulum leo
              ligula, molestie ullamcorper vulputate vitae sodales commodo nisl. Nulla
              facilisi. Pellentesque est metus many of some form.
            </p>
          </div>

          {/* Третья кнопка */}
          <button
            className="w-full inline-flex p-3 pl-6 justify-between items-center gap-4 rounded-lg bg-[#F8F7F0] hover:bg-[#E0DFD8] transition duration-300 mt-4"
            onClick={() => alert('Button 3 clicked!')}
          >
            <h3 className="text-md font-bold text-gray-800">Best vegetables for your healthy hair</h3>
            <div
              style={{
                display: 'flex',
                justifyContent: 'center',
                alignItems: 'center',
                borderRadius: '10px',
                background: '#C5CE38',
                width: '40px',
                height: '40px',
              }}
            >
              {/* Иконка или текст внутри квадрата */}
            </div>
          </button>
        </div>
      </div>
    </div>
  );
};

export default FAQSection;
